        "description": "¡Mantén la diversión en tu familia con Nintendo Switch!\n\nEste paquete contiene todo lo que necesitas para disfrutar de grandes batallas con Nintendo Switch, incluida una consola Nintendo Switch modelo OLED y un par de controladores Joy-Con con un diseño inspirado en el juego Super Smash Bros. Ultimate.\n\nPodrás disfrutar de un valor añadido con un código de descarga para el juego Super Smash Bros. Ultimate y una suscripción individual de 3 meses a Nintendo Switch Online.\n\nDisfruta de colores vivos y un contraste nítido con una pantalla OLED de 7\" pulgadas que hace que los colores resalten.\n\nSoporte ancho y ajustable diseñado para inclinar libremente para una visualización cómoda en el modo de sobremesa.\n\nUtiliza el puerto LAN de la base cuando juegues en modo TV para una conexión a Internet con cable.\n\nGuarda juegos en el sistema con los 64 GB de almacenamiento interno (una parte de la cual está reservada para uso del sistema).\n\nDisfruta del sonido mejorado de los altavoces integrados al sistema cuando juegues en los modos portátil y de sobremesa.\n\nSuper Smash Bros. Ultimate\n\nLanza a tus rivales del escenario usando uno de los nuevos personajes como Simon Belmont o King K. Rool que se unen a Inkling, Ridley y a todos los combatientes presentes en la historia de Super Smash Bros.\n\nDisfruta de la velocidad mejorada y combate en los nuevos escenarios basados en las series de Castlevania, Super Mario Odyssey y otras.\n\n¿No sabes cuál escenario elegir? Por primera vez en la serie puedes elegir la opción \"Escenario cambiante\" para que el escenario cambie repentinamente durante los combates.\n\nLos nuevos Combatientes Eco, Samus Oscura, Richter Belmont y Chrom se unen al combate. Juega en el modo local o en línea y disfruta de frenéticos combates, nuevos ataques y nuevas opciones de defensa como el escudo perfecto.\n\nEscucha más de 900 temas musicales diferentes mientras te enfrentas a tus amigos en combates 1 contra 1, todos contra todos para 4 jugadores o con hasta 8 jugadores, entre otros modos.\n\nAprovecha tu crédito Elektra y estrena un Nintendo Switch hoy.",
