        "description": "¡Encuentra las mejores parrillas en nuestra tienda en línea!\r\n\r\nCon la parrilla de GutStark podrás cocinar cinco diferentes platillos al mismo tiempo. La distribución de los quemadores depende de la capacidad térmica, entre más grande es el diámetro mayor será la temperatura. Diviértete cocinando y experimentando de forma segura con las recetas que más te gustan e impresiona a tu familia.\r\n\r\nLas parrillas Gutstark se están a la altura de los tiempos actuales y son tan versátiles que se puede utilizar con los gases más comunes, ya sea que cuentes con gas LP o bien natural, además, no es necesario hacer ajustes al momento de la instalación. Es tan sencillo que solo requieres conectarla y estará lista para usarse.\r\nLa nueva parrilla de GutStark se adapta perfectamente a tu vida diaria a la hora de cocinar. Por sus dimensiones y diseño es posible colocarla en cualquier superficie plana y totalmente seca; además, cuenta con encendido electrónico para una mayor comodidad, ¡olvídate de buscar el encendedor o los cerillos!\r\n\r\n Está diseñada con materiales sumamente resistentes, la estructura es de acero inoxidable con un acabado en vidrio templado que facilita su limpieza; y los quemadores de hierro fundido son ideales para resistir altas temperaturas. \r\n\r\nTipo de producto: Parrilla a gas.\r\nTipo de corriente: AC corriente alterna.\r\nTipo de encendido: Eléctrico.\r\nConsumo de energía: 7.28 W\r\nCorriente: 0.0625 A\r\nTensión: 120 V\r\nFrecuencia: 60 Hz\r\nConexiones: 120 V\r\nTipo de gas: Natural y LP.\r\nEntrada de la manguera de gas: 10 mm\r\nNúmero de quemadores: 5\r\nCapacidad térmica de cada quemador:\r\nø 13 cm: LP: 10,000 kj/h NAT: 11,000 kj/l\r\nø 10 cm: LP: 6,000 kj/l NAT: 7,400 kj/h\r\nø 7.5 cm (2): 4,000 kj/h NAT: 5,400 kj/h\r\nø 5 cm: 2,200 kj/h NAT: 3,100 kj/h\r\nMaterial: Acero inoxidable, hierro y vidrio.\r\nColor: Negro y plata.\r\nAcabado: Brillante.\r\nLongitud de cable: 120 cm\r\nTipo de control: Perillas metálicas.\r\n\r\nMEDIDAS (LARGO x ANCHO x ALTO)\r\nPeso del producto: 13.8 k\r\nMedidas para empotrar: 73 X 47 X 6 cm",
