        "description": "Trasládate de forma fácil y ahorrando combustible con una de las motocicletas de trabajo que tenemos para ti.\n\nLa motocicleta de trabajo FT150 tiene un motor de 4 tiempos monocilíndrico con una potencia máxima de 11.2 Hp @ 8500 RPM, una cilindrada de 149 CC y un torque máximo de 11 N-m @ 7500 RPM.\n\nSu sistema de arranque es eléctrico y de pedal muy fácil de utilizar, tiene transmisión estándar y frenos delanteros y traseros de tambor. Su suspensión delantera es de horquilla telescópica y la trasera es basculante doble amortiguador, mismas que te brindan mayor adherencia, control y confort al manejar.\n\nEsta sensacional moto alcanza una velocidad máxima de hasta 90 kilómetros por hora, cuenta con un tanque con capacidad de 12.5 litros y un rendimiento de combustible de 32 kilómetros por litro, además soporta un peso de hasta 150 kilos.\n\nSin duda esta motocicleta es tu compañera ideal para largas jornadas de trabajo al ser cómoda y resistente. Adquiérela ya y descubre todos los beneficios que tiene para ti. Se recomienda el uso de casco y equipo de seguridad.\n\n¡En nuestra tienda online encuentra la motocicleta que necesitas!",
