        "description": "En nuestra tienda en línea encuentra la moto de trabajo ideal para tus actividades diarias.\n\nSi lo que buscas es potencia, alto rendimiento y capacidad de carga, la motocicleta Italika FT150 TS es perfecta para ti. Este modelo te ofrece un sistema de arranque eléctrico y de pedal para mayor comodidad, cuenta con transmisión estándar, frenos delanteros y traseros de tambor, su suspensión delantera es de horquilla telescópica y la trasera es basculante doble amortiguador, mismas que te brindan gran adherencia, control y confort al manejar. \n\nGracias a su poder, alcanza una velocidad máxima de hasta 90 kilómetros por hora, cuenta con un tanque con capacidad de 13.3 litros y un rendimiento de combustible de 32 kilómetros por litro, además soporta un peso de hasta 150 kilos. Su motor de 4 tiempos tiene una potencia máxima de 11.2 Hp @ 8500 RPM, su cilindrada es de 149 CC y un torque máximo de 11 N-m @ 7500 RPM.\n \nAdquiérela hoy mismo y disfruta de todos los beneficios que tiene para ti. *Se recomienda el uso de casco y equipo de seguridad.",
