        "description": "Viaja con toda seguridad, comodidad y de forma fácil con una de las motocicletas que Italika tiene para ti.\n\nLa moto 250Z tiene un motor de 4 tiempos monocilíndrico con una potencia máxima de 17.9 Hp @ 7000 RPM, una cilindrada de 250 CC y un torque máximo de 17.7 N-m @ 6000 RPM. \n\nSu sistema de arranque es eléctrico para ser más fácil de usar, tiene transmisión estándar, frenos delanteros y traseros de disco, su suspensión delantera es de horquilla telescópica y la trasera es mono shock, mismas que te brindan mayor adherencia, control y confort al manejar. \n\nEsta sensacional moto alcanza una velocidad máxima de hasta 123 kilómetros por hora, cuenta con un tanque con capacidad de 11 litros y un rendimiento de combustible de 23.5 kilómetros por litro, además soporta un peso de hasta 150 kilos. \n\nSin duda esta motocicleta es perfecta para trasladarte al trabajo o pasear por la ciudad. Adquiérela ya y descubre todos los beneficios que tiene para ti. *Se recomienda el uso de casco y equipo de seguridad.",
